function calc_cmc(cost) {
    var cmc = 0;
    for (var i = 0; i < cost.length; i++) {
        var c = cost[i]; 
        if (c % 1 === 0) {
            cmc += parseInt(c, 10);
        }
        if (c === "}") {
            cmc--;
        } else if (_.contains(["W", "U", "B", "R", "G"], c)) {
            cmc++;
        }
    }
    return cmc;
}

var card_map = {};
for (var i = 0; i < cards.length; i++) {
    var c = cards[i];
    c.cmc = calc_cmc(c.cost);
    card_map[c.name.toLowerCase()] = Cards.insert(c);
}

for (var i = 0; i < pools.length; i++) {
    var pool = pools[i];
    var pool_id = Pools.insert({name: pool.name});

    for (var j = 0; j < pool.cards.length; j++) {
        var c = pool.cards[j];
        var n = c.name.toLowerCase();
        if (!card_map[n]) {
            console.log("NAO ENCONTROU: " + n);
            continue;
        }
        PoolCards.insert({
            pool_id: pool_id,
            card_id: card_map[n],
            amount: c.amount});
    }
}
